import React from 'react';
import './App.css'; // Import the App.css file

function GeneratedEmail({ generatedEmail }) {
    return (
        <div>
            <h2>Generated Email</h2>
            <p>{generatedEmail}</p>
        </div>
    );
}

export default GeneratedEmail;
